snippet.textDisplay:
Hijr main guzray huway waqt ka moul nahi,
Guzri sadyun ko main lamhun ki tarah ginta hun;

Jab bhi uthtay hain meray haath duwawun kay liyay,
Niyamatain do jhaan ko chood tumko chunta hun;

Daleel, noor e roy e yaar kay mujasma ki,
Haye afsoos ye nadaangi ki bunta hun;

